const Menu = ({ products, activeTab, activeTabIndex, onTabSwitch, onAddProduct }) => {
    return (
        <div className="bg-white">
            <div className="menu-wrapper">
                <Tabs
                    list={['Product 1', 'Product 2', 'Product 3']}  // Static tab names for example
                    activeTab={activeTab}
                    onTabSwitch={onTabSwitch}
                />
                <div className="flex flex-row mx-3">
                    {
                        products && products[activeTabIndex].products.map((product, index) => {
                            return (
                                <ProductDetailCard key={index} product={product} onAddProduct={onAddProduct} />
                            )
                        })
                    }
                </div>
            </div>
        </div>
    )
}

export default Menu;
